1. 이용자 서비스의 중단 및 종료

이용자가 불법 정보를 게시하거나 사회 도덕을 심각하게 위반하거나 법률의 금지 사항을 위반하는 경우 개발자는 이용자에 대한 서비스 제공을 종료해야 합니다.
사용자가 소프트웨어 서비스를 수락할 때 부적절한 행위를 하는 경우 개발자는 사용자에게 제공된 서비스를 종료할 권리가 있습니다(부적절한 행동의 구체적인 상황은 본 계약에 명확하게 명시되어 있음).
사용자가 제3자의 수정된 버전의 소프트웨어를 사용하는 경우 사용자는 자신의 위험과 법적 책임을 져야 합니다.

2. 소프트웨어 및 서비스의 중단, 중단 및 종료：

다음과 같은 상황이 발생할 경우 개발자는 소프트웨어 서비스의 전부 또는 일부를 종료하거나 중단할 수 있는 권리를 가지며, 개발자는 이로 인해 발생하는 불편이나 손해에 대해 사용자 또는 제3자에게 책임을 지지 않습니다：

a. 소프트웨어 및 서비스에서 요구하는 경우;
b. 서버 손상으로 인해 제대로 작동하지 않는 경우;
c. 소프트웨어 및 하드웨어 장비 및 전자 통신 장비의 갑작스러운 고장으로 인해;
d. 네트워크 공급자 회선 또는 기타 장애로 인해;
e. 정책적 고려 사항으로 인해;
f. 제3자의 사유 또는 기타 불가항력 상황.

개발자는 필요하다고 판단되는 경우 소프트웨어 및 서비스를 종료하거나 부분적으로 종료할 수 있는 권리를 보유하며, 개발자는 공지 형식으로 사용자에게 통지할 수 있지만 개발자는 사용자에게 발생한 손실에 대해 책임을 지지 않습니다.
